import React from 'react';
import ReactDOM from 'react-dom';
import { ThemeProvider } from 'react-bootstrap'; // Import the context provider you're using
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider>
      <App />
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
